import React from "react";
import swim from "../img/swim.png"
import star from "../img/Star.png"


export default function Card(){
    return(
       <div>
        <img src={swim}/>
        <div>
            <img src={star} width="16.5px"/>
            <p>(6).usa</p>
        </div>

       </div>
    )
}
